t.add("testpaper.course.rule.tips", "\u3010\u666e\u901a\u8bfe\u7a0b\u89c4\u5219\u3011\n  <br>\n  1.\u514d\u8d39\u8bfe\u7a0b\uff1a\u5373\u514d\u8d39\u7684\u8bfe\u7a0b\uff0c\u5fc5\u987b\u8981\u767b\u5f55\u624d\u80fd\u52a0\u5165\u5b66\u4e60\u3002<br>\n  2.\u514d\u8d39%taskName%\uff1a\u5373\u52fe\u9009\u4e86%taskName%\u6807\u9898\u65c1\u3010\u514d\u8d39%taskName%\u3011\u7684%taskName%\uff0c%taskName%\u6807\u9898\u524d\uff0c\u6709\u201c\u514d\u8d39\u201d\u6807\u7b7e\u3002<br>\n  3.\u514d\u8d39\u8bd5\u770b\uff1a\u5373\u8bbe\u7f6e\u4e86\u8bd5\u770b\u65f6\u957f\u5e76\u4e14\u6709\u201c\u8bd5\u770b\u201d\u6807\u7b7e\u7684%taskName%\uff0c\u76ee\u524d\u53ea\u6709\u4e91\u89c6\u9891\u652f\u6301\u8bd5\u770b\u3002<br>\n  4.\u7ba1\u7406\u5458\u53ef\u5728\u3010\u7ba1\u7406\u540e\u53f0\u3011-\u3010\u7cfb\u7edf\u3011-\u3010\u8bfe\u7a0b\u8bbe\u7f6e\u3011-\u3010\u8bfe\u7a0b\u3011\u4e2d\u5f00\u542f\u3010\u514d\u8d39%taskName%\u5141\u8bb8\u672a\u767b\u5f55\u7528\u6237\u89c2\u770b\u3011\u3002<br>\n  <br>\n  \u3010\u76f4\u64ad\u8bfe\u7a0b\u89c4\u5219\u3011<br>\n  1.\u76f4\u64ad\u8bfe\u7a0b\uff0c\u5fc5\u987b\u8bbe\u7f6e\u8bfe\u7a0b\u4eba\u6570\u624d\u80fd\u53d1\u5e03\uff0c\u5426\u5219\u7528\u6237\u65e0\u6cd5\u52a0\u5165\/\u8d2d\u4e70\u8bfe\u7a0b\u3002<br>\n  2.\u8bfe\u7a0b\u4eba\u6570\u2260\u8d2d\u4e70\u7684\u76f4\u64ad\u4eba\u6570\uff0c\u6bcf\u573a\u76f4\u64ad\u53c2\u4e0e\u7684\u6700\u5927\u4eba\u6570\u2264\u8d2d\u4e70\u7684\u76f4\u64ad\u4eba\u6570\u3002<br>\n  3.\u82e5\u8bfe\u7a0b\u4eba\u6570\uff1e\u8d2d\u4e70\u7684\u76f4\u64ad\u4eba\u6570\uff0c\u53ef\u80fd\u4f1a\u51fa\u73b0\u90e8\u5206\u7528\u6237\u65e0\u6cd5\u8fdb\u5165\u76f4\u64ad\u6559\u5ba4\u7684\u60c5\u51b5\u3002<br>\n  4.\u82e5\u76f4\u64ad\u6709\u56de\u653e\u89c6\u9891\uff0c\u672a\u53c2\u4e0e\u76f4\u64ad\u8fc7\u7a0b\u7684\u7528\u6237\uff0c\u53ea\u8981\u52a0\u5165\u8bfe\u7a0b\uff0c\u4e5f\u53ef\u89c2\u770b\u56de\u653e\u3002<br>\n", "js", "zh_CN");
