t.add("admin.question_bank.manage.model", "<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-Promote\"><\/i>\u65b0\u7248\u9898\u5e93\u529f\u80fd\uff0c\u5168\u9762\u63d0\u5347\u590d\u7528\u6027<\/p> <p class=\"question-bank-model-text\">\u5728\u65b0\u7248\u9898\u5e93\u4e2d\u521b\u5efa\u7684\u9898\u76ee\u548c\u8bd5\u5377\u53ef\u4ee5\u5728\u6240\u6709\u8bfe\u7a0b\u4e2d\u5f15\u7528\uff0c\u5168\u9762\u63d0\u5347\u4e86\u9898\u76ee\u548c\u8bd5\u5377\u7684\u590d\u7528\u6027\u3002<\/p>\n<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-manage\"><\/i>\u65b0\u589e\u9898\u76ee\u5206\u7c7b\uff0c\u9898\u76ee\u7ba1\u7406\u66f4\u65b9\u4fbf<\/p> <p class=\"question-bank-model-text\">\u6bcf\u4e2a\u9898\u5e93\u4e2d\u90fd\u53ef\u4ee5\u521b\u5efa\u4e00\u5957\u9898\u76ee\u5206\u7c7b\uff0c\u65e0\u9700\u518d\u4ece\u5c5e\u4e8e\u6559\u5b66\u8ba1\u5212\u6216\u8005\u8bfe\u65f6\uff0c\u65b9\u4fbf\u7f51\u6821\u7ba1\u7406\u9898\u76ee\u3002<\/p>\n<p class=\"question-bank-model-title\"><i class=\"es-icon es-icon-efficiency\"><\/i>\u8bd5\u5377\u521b\u5efa\u4f18\u5316\uff0c\u521b\u5efa\u6548\u7387\u5927\u63d0\u5347<\/p> <p class=\"question-bank-model-text\">\u7528\u6237\u53ef\u4ee5\u4e00\u6b21\u6027\u6dfb\u52a0\u591a\u4e2a\u9898\u578b\u7684\u9898\u76ee\uff0c\u5e76\u4e14\u65b0\u589e\u4e86\u8de8\u9875\u8fde\u9009\u529f\u80fd\uff0c\u5927\u5927\u63d0\u5347\u4e86\u521b\u5efa\u8bd5\u5377\u7684\u6548\u7387\u3002<\/p>\n<p class=\"question-bank-model-title question-bank-model__special\"><i class=\"es-icon es-icon-Explain\"><\/i>\u7279\u522b\u8bf4\u660e<\/p> <p class=\"question-bank-model-text\">\u8001\u6570\u636e\u5904\u7406\uff1a\u539f\u8bfe\u7a0b\u4e2d\u7684\u9898\u76ee\u548c\u8bd5\u5377\u90fd\u642c\u8fc1\u5230\u65b0\u7248\u9898\u5e93\u4e2d\u4e86\uff0c\u539f\u5148\u6559\u5e08\u6709\u6743\u9650\u7ba1\u7406\u7684\u9898\u5e93\uff0c\u73b0\u5728\u4f9d\u7136\u6709\u6743\u9650\u7ba1\u7406<\/p>\n", "js", "zh_CN");
